INSERT INTO `catalog_pages` VALUES ('30', '3', '81', '1', '0', 'Mode', '39', '0', '1', 'default_3x3', 'catalog_mode_headline1_de|catalog_mode_teaser1|catalog_special_txtbg2', 'Hartes, grauses Industrie-Standardmetal mit einem glatten Design. Die perfekte Mbelreihe fr einen Stadtbewohner.|Artikel anklicken, um mehr Infos zu erhalten!|So glnzend und neu..');
