INSERT INTO `catalog_pages` VALUES ('34', '3', '75', '1', '0', 'Landleben', '21', '0', '1', 'default_3x3', 'country_header1_en_001|country_teaser1|catalog_special_txtbg2', 'Lasst uns die vollen Stadtstraen verlassen und auf Land umsiedeln. Hier erwarten dich Maisfelder und Bio-Gemse. Alles was du brauchst, um einen Bauernhof zu grnden!|Artikel anklicken, um mehr Infos zu erhalten!|Macht mal jemand die Tr zu?\r\n');
