INSERT INTO `catalog_pages` VALUES ('345476664', '345476624', '1', '1', '0', 'Belohnungen', '26', '0', '1', 'recycler_prizes', 'catalog_recycler_headline3', 'Dies sind die aktuellen Belohnungen, die du beim Eintauschen von Mbeln ergattern kannst.');
INSERT INTO `catalog_pages` VALUES ('345476665', '345476624', '0', '1', '0', 'Anweisungen', '42', '0', '1', 'recycler_info', 'catalog_recycler_headline3|ctlg_ecotron_box', 'Ecotron ist ein Recycler fr deine Mbel, lass los von deinem alten Zeug.. dafr bekommst du auch etwas schnes zurck. Was genau? Eine berraschung.. keine Rckerstattung.|\r\nVerwendung von Ecotron|1. Lass das Hauptfenster von Ecotron geffent, wenn du auf die Schaltflche \"Inventar\" klickst. Du wirst sehen, dass die meisten deiner Gegenstnde mit einem Recycling-Sysmbol versehen sind. Das bedeutet, dass du sie anklicken und in Ecotron ziehen kannst.\r\n2. Wenn du genug Gegenstnde hineingezogen hast, klicke auf \"Start!\" und such die Ecotorn-Box in deinem Inventar.\r\n3. Klicke auf die Box und ffne sie oder tausche sie ungeffnet. Um die Seltenheit deines inhaltenen Mbelstcks zu sehen, kannst du diese auf der Katalogseite \"Belohnungen\" herausfinden.');
